import React from "react";
import "../../autorisation/autor.css"
import Logo from '../../autorisation/comp/logo';

class MainMenuRegistr extends React.Component{
    render(){
        return(
            <div className="autorMenu">
                <Logo />
            </div>
        );
    }
}

export default MainMenuRegistr;
